import React from 'react';

const Sidebar = () => {
  return (
    <div className="h-screen bg-gray-800 text-white w-64 space-y-6 py-7 px-2">
      <h1 className="text-3xl font-semibold text-center">
        MyApp
      </h1>
      <nav>
        <a href="/" className="block py-2.5 px-4 rounded transition duration-200 hover:bg-gray-700">
          Home
        </a>
        <a href="/about" className="block py-2.5 px-4 rounded transition duration-200 hover:bg-gray-700">
          About
        </a>
        <a href="/services" className="block py-2.5 px-4 rounded transition duration-200 hover:bg-gray-700">
          Services
        </a>
        <a href="/contact" className="block py-2.5 px-4 rounded transition duration-200 hover:bg-gray-700">
          Contact
        </a>
      </nav>
    </div>
  );
};

export default Sidebar;
